import styled from 'styled-components';
import pHeader from './components/provider/pHeader';
import { Component } from 'react';
import Router from './Routes/Router'


class Provider extends Component{
  render(){
    return(
      <>
        <HeaderLayout>
          <pHeader/>
        </HeaderLayout>
        <BodyLayout>
          <Router/>
        </BodyLayout>
      </>
    )
  }
}

export default Provider;

const HeaderLayout = styled.div`
  margin: 0 auto;
  display: flex;
  width: 100vw;
  flex-flow : row wrap;
`
const BodyLayout = styled.div`
  margin: 0 auto;
  display: flex;
  width: 100%;
  flex-flow : row wrap;
`
